const fetch = require("node-fetch");

export const getItems = () => {
  let fetch = require("node-fetch");

  let res = fetch("http://localhost:3221/items", {
    headers: {
      Accept: "application/json",
      Authorization: "Bearer " + getToken(),
    },
  });
  return res;
};
